import React from 'react';

function Contact() {
  return (
    <section id="contact" className="contact">
      <h2>Contato</h2>
      <p>Me envie uma mensagem pelo <a href="https://wa.me/5561986115281">WhatsApp</a></p>
    </section>
  );
}

export default Contact;
